import React from 'react'
import { useState } from 'react'

const Items = () => {
        const [items,setItems] =useState([
            {
            id:1,
            image: 'Icons_1',
            num:'$99,125.00',
            text:'Todays Revenue'
            },
            {
            id:2,
            image:'Icons_2',
            num:'365',
            text:'Transactions'
            }])
      return(
      <div>
        {items.map((item)=>{
            return(
                <div key={item.id}>
                </div>
                
            )
            
        })}
        </div>
      )
    }

export default Items
